import { NavLink } from "react-router-dom";
import { Nav } from "react-bootstrap";

function NavBar() {
    return (
        <div>
        <Nav variant="pills" className="justify-content-center">
            <Nav.Item>
                <Nav.Link href="/">
                    Home
                </Nav.Link>
            </Nav.Item>
            <Nav.Item>
                <Nav.Link href="/pontuacao">
                    Pontuação
                </Nav.Link>
            </Nav.Item>
        </Nav>
        </div>
    )
}

export default NavBar;
